import CourseGoalList from "./components/CourseGoalList";
import Header from "./components/Header";
import GoalImage from "./assets/goals.jpg";
import "./App.css";

function App() {
  return (
    <main>
      <div>
        <Header image={{ src: GoalImage, alt: "Goal Image" }}>
          <h1>Your Course Goals</h1>
        </Header>
        <CourseGoalList />
      </div>
    </main>
  );
}

export default App;
